// 4. \u521B\u5EFA\u624B\u673A
const myMobile = new FakeStarFactory();
// \u521D\u59CB\u5316\u64CD\u4F5C\u7CFB\u7EDF
const myOS = myMobile.createOS();
// \u521D\u59CB\u5316\u786C\u4EF6
const myHardWare = myOS.createHardWare();

// \u542F\u52A8\u64CD\u4F5C\u7CFB\u7EDF
myOS.controlHardWare();

// \u5524\u9192\u786C\u4EF6\u547D\u4EE4
myHardWare.operateByOrder();
