    let canvas = canvasRef3.current;
    let ctx = canvas.getContext('2d');

    ctx.font = '40px serif';
    ctx.textBaseline = 'top';
    ctx.textAlign = 'start';
    ctx.strokeText('hello world', 0, 100);
